  //   });
  //   this.setState({
  //     UserLocation: userCoordinates
  //   })
  // }

  // {this.getUserLocation()}

  render() {

    return (
      <div>
      <h1>SHITTTTTTTTT</h1>
      <Map
        {...mapProps}
        containerStyle={{
          height: "100vh",
          width: "100vw"
        }}>
          <Layer
            type="symbol"
            id="marker"
            layout={{ "icon-image": "marker-15" }}>
            <Feature coordinates={[-0.481747846041145, 51.3233379650232]}/>
          </Layer>
      </Map>
      </div>
    );
  }
}

export default MapBox;
